import React from 'react';
import './Button.css'
import { Container, Row, Col } from 'react-bootstrap';

const Button = ({num}) => {
  return (
    <Container>
      <Row className="justify-content-center">
        <Col xs={10} lg={6} style={{ height: "20rem" }} className="mt-4 align-middle rounded-circle RollCard">
            <Row className="py-3">
              <Col xs={3}>{num}</Col>
            </Row>
        </Col>
      </Row>
    </Container>
  );
}

export default Button;
